// timer for AMCAP
var amcapTimer:Timer = new Timer(5000);

amcapTimer.addEventListener(TimerEvent.TIMER, checkAMCAP);

function checkAMCAP(event:TimerEvent)
{
	var currentApp:String;
	var amcapStatus:Boolean=false;
	//myDebug.text="Checking AMCAP"+String(Math.random());
	var windowList:Array = mdm.System.getWindowList();

for (var n=0; n<windowList.length; n++) {
	currentApp=windowList[n][0];
	currentApp=currentApp.toLowerCase();
		if(currentApp.indexOf("amcap")>=0) {
		myDebug.text="AMCAP running "+String(Math.random());
		amcapStatus=true;
	} 
}
if (!amcapStatus) {
		myDebug.text="AMCAP CLOSED "+String(Math.random());
		amcapTimer.stop();
		mdm.Application.bringToFront();
		setupCamera(camera,cameraList_combo.selectedIndex,Number(cameraWidth_txt.text),Number(cameraHeight_txt.text));

	}

}


