var camera:Camera = Camera.getCamera();

var cameraList:DataProvider=new DataProvider();

for (var i=0; i<Camera.names.length; i++)
{
	cameraList.addItem({label:Camera.names[i]});
}

cameraList_combo.dataProvider = cameraList;

cameraList_combo.addEventListener(Event.CHANGE,cameraList_listener);

function cameraList_listener(e:Event)
{
	var selectedCamera:String = String(e.target.selectedIndex);
	trace("combobox changed"+selectedCamera);
	setupCamera(camera,Number(e.target.selectedIndex),Number(cameraWidth_txt.text),Number(cameraHeight_txt.text));
}

