function resetSliders()
{
	RGre_slider.value = 40;
	RBlk_slider.value = 20;
	AGre_slider.value = 100;
	STsp_slider.value = 100;
	SKTp_slider.value = 70;
	ABGl_slider.value = 100;
}

function setupCamera(camera:Camera,cameraId:Number,cameraWidth:Number,cameraHeight:Number)
{
	// resects actual camera
	trace("camera:"+camera.toString());
	trace("cameraId:"+String(cameraId));
	trace("cWidth:"+String(cameraWidth));
	trace("cHeight:"+String(cameraHeight));
	//trace("SETUPCAMERA");

	video.attachCamera(null);
	camera = Camera.getCamera(String(cameraId));
	camera.setMode(cameraWidth,cameraHeight,15,true);
	camera.setQuality(0,90);
	video.smoothing = true;
	myDebug.appendText("ATTACHING CAMERA:"+String(cameraId)+"\n");
	video.attachCamera(camera);
	cameraWidth_txt.text = String(camera.width);
	cameraHeight_txt.text = String(camera.height);
	var newWidth:Number = camera.width;
	var newHeight:Number = camera.height;
	var ratio:Number = newWidth / newHeight;

	//saveSettings();

}

function activityHandler(event:ActivityEvent):void
{
	trace("activityHandler: " + event);
}

