mdm.Application.init( this, onInit );

function onInit()
{
	preview.visible = false;
	trace("zinc initiated");
	mdm.Application.bringToFront();
	appPath = mdm.Application.path;
	// write temp photoshop files
	writePhotoShopTMP()
	//
	if (mdm.FileSystem.fileExists(appPath + "settings\\appSettings.txt"))
	{
		//mdm.Dialogs.prompt("SETTINGS EXISTS");

	}
	else
	{
		var settingsTXT:String = "0|1024|768|40|20|100|100|70|100";
		mdm.FileSystem.saveFile(appPath+"settings\\appSettings.txt", settingsTXT);
		mdm.Dialogs.prompt("NO SETTINGS FOUND");
	}

	if (camera != null)
	{
		camera.addEventListener(ActivityEvent.ACTIVITY, activityHandler);
		loadSettings();

		_transformTool = new TransformTool();
		_transformTool.mode = TransformTool.SCALE;
		_transformTool.iconScale = new HandleHintScale();
		_transformTool.iconRotate = new HandleHintRotate();
		//_transformTool.boundaries = new Rectangle(0, 0, 800, 600);
		addChild(_transformTool);

		// register targets //    
		_transformTool.targets = [f3,clipMask];
		_transformTool.activeTarget = f3;

	}
	else
	{
		mdm.Dialogs.prompt("YOU NEED A WEBCAM");
		mdm.Application.exit();
	}


	/*mdm.Dialogs.BrowseFolder.title="Please the folder where you will save the data capture";
	if (mySo.data.saveFolder!=null) {
	saveURL.text=mySo.data.saveFolder;
	mdm.FileSystem.setCurrentDir(mySo.data.saveFolder);
	} else {
	var myFolder:String=mdm.Dialogs.BrowseFolder.show();
	saveURL.text=myFolder;
	mySo.data.saveFolder=myFolder;
	mdm.FileSystem.setCurrentDir(myFolder);
	}
	if (mySo.data.saveFolder!=null) {
	urnsteps.value=mySo.data.urn;
	} else {
	urnsteps.value=7;
	mySo.data.urn=7;
	}
	*/

}

/* load the txt file */ 
function loadSettings()
{
	if (mdm.FileSystem.fileExists(appPath + "settings\\appSettings.txt"))
	{
		myDebug.text = "LOADED SETTINGS";
		var settingsTXT:String = mdm.FileSystem.loadFile(appPath + "settings\\appSettings.txt");
		var settings:Array = settingsTXT.split("|");
		myDebug.appendText("CAMERA ON SETTINGS:"+settings[0]+"\n");
		cameraList_combo.selectedIndex = Number(settings[0]);
		setupCamera(camera,Number(settings[0]),Number(settings[1]),Number(settings[2]));
		RGre_slider.value = settings[3];
		RBlk_slider.value = settings[4];
		AGre_slider.value = settings[5];
		STsp_slider.value = settings[6];
		SKTp_slider.value = settings[7];
		ABGl_slider.value = settings[8];
		f3.x = settings[9];
		f3.y = settings[10];
		f3.width = settings[11];
		f3.height = settings[12];
		clipMask.x = settings[13];
		clipMask.y = settings[14];
		clipMask.width = settings[15];
		clipMask.height = settings[16];
	}
	else
	{
		myDebug.text = "NEW SETTINGS";
		resetSliders();
		setupCamera(camera,0,1024,768);

	}
	//mdm.Dialogs.prompt("SETTINGS LOADED!"+String(settings.length));
}

/* save settings */

function saveSettings()
{
	var settingsTXT:String = String(cameraList_combo.selectedIndex) + "|" + cameraWidth_txt.text + "|" + cameraHeight_txt.text + "|";

	settingsTXT +=  RGre_slider.value.toString() + "|";
	settingsTXT +=  RBlk_slider.value.toString() + "|";
	settingsTXT +=  AGre_slider.value.toString() + "|";
	settingsTXT +=  STsp_slider.value.toString() + "|";
	settingsTXT +=  SKTp_slider.value.toString() + "|";
	settingsTXT +=  ABGl_slider.value.toString() + "|";
	settingsTXT +=  f3.x + "|";
	settingsTXT +=  f3.y + "|";
	settingsTXT +=  f3.width + "|";
	settingsTXT +=  f3.height + "|";
	settingsTXT +=  clipMask.x + "|";
	settingsTXT +=  clipMask.y + "|";
	settingsTXT +=  clipMask.width + "|";
	settingsTXT +=  clipMask.height;

	mdm.FileSystem.saveFile(appPath+"settings\\appSettings.txt", settingsTXT);


}
stop();

preview.ok_btn.addEventListener(MouseEvent.CLICK, fl_MouseClickHandler_4);

function fl_MouseClickHandler_4(event:MouseEvent):void
{
	mdm.FileSystem.deleteFile(appPath+"output\\ZZZZZZZZ.jpg");
	deletePreview()
	preview.visible = false;
}
function loadPreview()
{

	var my_loader:Loader = new Loader();
	my_loader.load(new URLRequest(appPath+"output\\ZZZZZZZZ.jpg"));
	preview.container.addChild(my_loader);

	my_loader.contentLoaderInfo.addEventListener(IOErrorEvent.IO_ERROR, LOADioErrorHandler);




}
function LOADioErrorHandler(event:IOErrorEvent):void {
	myDebug.text = "ioErrorHandler: " + event;
}
function deletePreview() {
	while (preview.container.numChildren) preview.container.removeChildAt(0); 
	_transformTool.visible = true;
	f3.visible = true;
	clipMask.visible = true;

}

function writePhotoShopTMP() {
	var saveString:String="var URN=\"ZZZZZZZZ\"\r\nvar club_logo=\"\"\r\nvar club_trophy=\"arsenal_cup.png\"\r\nvar bkgImg=\"BGround_Arsenal.jpg\"";
	mdm.FileSystem.saveFile(appPath+"settings\\urn.jsx", replace(saveString, String.fromCharCode(92), String.fromCharCode(92)+String.fromCharCode(92)));
}

